import { configureStore } from "@reduxjs/toolkit";
import { Provider } from "react-redux";

import "./App.css";
import todoSlice from "./features/todoSlice";
import TodoList from "./comps/todoList";

const store = configureStore({
  reducer: {
    todoSlice,
  },
});

function App() {
  return (
    <Provider store={store}>
      <TodoList />
    </Provider>
  );
}

export default App;
